Bu yazımda ana sayfayı yukarıda gördüğünüz duruma getireceğiz. Buraları isterseniz atlayabilirsiniz. İlk olarak ana sayfayı oluşturmaya başlayacağız. Bunun için istediğimiz bir yere dosya açıyoruz. Bu dosyaya “trendol” diyelim. Ve bu dosyanın içine tekrar “template” dosyası açıyoruz. İçine “index.html” sayfası oluşturuyoruz. Bu sayfaya uygulamamızın ana sayfasını oluşturacağız. Html head ve body taglerini açalım. İlk olarak header, içerik ve footer oluşturacağız.

```javascript
<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Trendol</title>
</head>
<body>
    <header>Trendol</header>
    <main>
        <ul>
            <li>Ürün 1</li>
            <li>Ürün 2</li>
            <li>Ürün 3</li>
            <li>Ürün 4</li>
            <li>Ürün 5</li>
            <li>Ürün 6</li>
        </ul>
    </main>
    <footer> Tüm Hakları Saklıdır </footer>
</body>
</html>
```

Stil verebilmek için ise bir CSS sayfası oluşturuyoruz. Template dosyası içine “style.css” açıyoruz. Ve head tagi içine tanımlıyoruz.

```javascript
    <link rel="stylesheet" href="style.css">
```
Style.css içine yazmaya başlayalım.

```css
html {
    
    box-sizing: border-box;
}

```

border-box, tarayıcıya bir öğenin genişliği ve yüksekliği için belirttiğiniz değerlerde herhangi bir border ve paddingi hesaba katmasını söyler. Yani bir öğenin genişliğini 100 piksel olarak ayarlarsanız bu 100 piksel eklediğiniz herhangi border veya paddingi içerecektir ve içerik kutusu bu ekstra genişliği ortadan kaldırmak için küçülecektir.

```css
body {
    font: 1.5rem Helvetica;
    height: 100vh;
    margin: 0;
}
```

Body için ise yazı stili ve boyutu, yükseklik ayarlıyoruz. İstemediğimiz boşluk olmasın diye margine 0 veriyoruz. Şimdi html sayfamızı çalıştırırsak fontun değiştiğini ve margin olmadığını görürüz.
Sıradaki işlem ise bir grid sistemi oluşturmak. 

```css
.grid-container {
    display: grid;
    grid-template-areas: 
    "header"
    "main"
    "footer";
    grid-template-columns: 1fr;
    grid-template-rows: 5rem 1fr 3rem;
    height: 100%;
}
```

Burada tanımlanan grid-template-areas ekranımızı yukarıdan aşağıya, isimlerini bizim belirlediğimiz üç parçaya ayırır. Bu parçalara grid-area özelliğiyle istediğimiz şekilde nitelik ekleyebileceğiz . Biz burada header ı navbar olarak özelleştireceğiz. Main içeriğimiz, footer ise adı üstünde footer olacak.

 “grid-template-columns” ekranımızı soldan sağa bölmeye yarar. Fakat biz ekranı bölmek istemediğimiz için 1fr(fraction:kesir) olarak ayarlıyoruz. “grid-template-rows” ise yukarıdan aşağıya bölmelerin hangi ölçüde olacağını ayarlıyor. “areas”ta belirlediğimiz sıraya göre istediğimiz genişliği ekliyoruz. Ve önemli bir ayrıntı olan yüksekliği de unutmuyoruz. Yüksekliği sayfanın tamamını kaplaması için 100% verdik. Aksi takdirde rowlar istediğimiz şekilde konumlanmaz. 
 
Şimdi belirlediğimiz arealar için sınıf oluşturalım.


```css
.header {
    grid-area: header;
}

.main {
    grid-area: main;
}

.footer {
    grid-area: footer;
}
```

Bu sınıflara daha sonra özellik ekleyeceğiz. Şimdi bu sınıfları html sayfamıza tanımlayalım.

```html
<body>
    <div class="grid-container">
    <header class="header">Trendol</header>
    <main class="main">
        <ul>
            <li>Ürün 1</li>
            <li>Ürün 2</li>
            <li>Ürün 3</li>
            <li>Ürün 4</li>
            <li>Ürün 5</li>
            <li>Ürün 6</li>
        </ul>
    </main>
    <footer class="footer"> Tüm Hakları Saklıdır </footer>
</div>
</body>
```

Bu classları tanımladıktan sonra chrome’dan sayfamıza bakarsak headerın yukarıda footerın ise en aşağıda konumlandığını görürüz. şimdi biraz header ı ele alalım. Öncelikle header kısmına ekleme yapıyoruz. Sağ üst köşeye sepetim ve giriş yap seçenekleri ekleyelim.

```html
 <header class="header">
        <div class="brand">
            <a href="index.html">trendol</a>
        </div>
        <div class="header-links">
            <a href="cart.html">Sepetim</a>
            <a href="signin.html">Giriş Yap</a>
        </div>
    </header>
```

Sıradaki işlem headera şekil vermek olacak. 

```css
.header {
    grid-area: header;
    display: flex;
    justify-content: space-between;
    align-items: center;
    border-bottom: 1px solid gray;
    padding: 2rem;
}

.brand a {
    text-decoration: none;
    font-size: 3rem;
    color: #000;
    font-weight: bold;
}

.header-links a {
    color: #3d3c3a;
    text-decoration: none;
}
```

Flex ile esneklik özelliğini açıyoruz. Space-between ise headerın öğelerini yan yana konumlandırmak yerine iki tarafa gönderiyor. Başlık solda, diğer seçenekler ise sağda kalıyor. “align-items: center” ise seçeneklerimizi, yukarıdan aşağıya headerın ortasında konumlanmasını sağlıyor. Padding header öğelerine yanlardan boşluk ekliyor. Şu anda sade bir stil istediğim için sadece alt kısma ince bir border ekledim. a taglerini ise yine sade tuttum. Yine de küçük bir hover effect ekliyorum.

```css
.header-links a:hover {
    color: #fc6405;
}
```

Aynı işlemi brand için de yapıyoruz. bu yazının son işlemi olarak footera stil verelim.

```css
.footer {
    grid-area: footer;
    background-color: #2d2d2d;
    color: #fff;
    display: flex;
    justify-content: center;
    align-items: center;
}
```

Yine display özellikleriyle yazımızı ortada konumluyoruz.

<div><img src="../../images/anasayfa1.png" alt="anasayfa ilk gorunum" /></div>


