Şimdi "img" içindeki yola uygun biçimde bir resim ekleyelim.”template” in bulunduğu dosyaya “images” dosyası açıyoruz. İçine herhangi bir resim sürükleyip bırakıyoruz. Sonra sağ tıklayıp “rename” e basıp buradaki ismi veriyoruz ki resmi bulabilsin. Kısa isimler verirseniz işiniz daha kolay olur. Bu işlemden sonra artık resmi sayfamızda görebiliriz. Ve alt kısmında ürün ismi markası ve fiyatı da görünüyor. Fakat resim kendi büyüklüğünde ve şu anki görünüm korkunç :D. Şimdi bu görünümü düzenlemeye başlayalım. 

```css
.products {
    display: flex;
    justify-content: center;
    align-items: center;
}

.products li {
