}
```

Önceliğimiz tüm ürünlerin ortalanması. Bunun için de flex ayarlamalarını yapıyoruz. “justify-content” ve “align-items”e center içeriğimizi ortalar.
 İkinci olarak ürünler içindeki tüm "li" lere stil veriyoruz. “flex” özelliğinde görüldüğü üzere 3 seçenek oluşturuyoruz. Birincisi "flex-grow" : Esnek bir ürünün gerektiğinde büyüme yeteneğini tanımlar. İkincisi ise "flex-shrink" satırda yeterli alan olmadığında esnek ürünün diğer esnek öğelere göre ne kadar küçüleceğini ayarlar. Üçüncü seçenek "flex-basis": esnek öğenin başlangıç boyutunu belirtir. Bu seçenekleri eğer istersek ayrı ayrı da tanımlayabiliriz.
Border ve yükseklik istediğimiz gibi ayarlıyoruz. İstenmeyen liste stilinden kurtulmak için “list-style-type: none” ekliyoruz. Son olarak resme de maksimum ulaşabileceği büyüklüğü tanımlıyoruz. 

