Bu yazımda ürün kategorilerinden oluşan sidebarı halledeceğiz. Sol üst köşede sidebarın açılacağı hamburger ikonumuz olacak. Tıkladığımızda bize kategorileri gösterecek. Sidebarın sağ köşesinde kapatmak için buton olacak. İlk olarak hamburger butonu ile başlayalım. 
```html
        <div class="brand">
            <button>
                &#9776;
            </button>
            <a href="index.html">trendol</a>
        </div>
```
Brand altına button ekliyoruz. İçine hamburger butonu oluşturacak kodu yazıyoruz. kodu çalıştırdığımızda stil verilmemiş bir hamburger görürüz.

  <div><img src="../../images/hamburger.png" alt="hamburger" style="margin:20px" /></div>

   Şimdi ihtiyacımız olan şey bu butona stil vermek.

   ```css
.brand button {
    font-size: 3rem;
    font-weight: 900;
    padding: .5rem;
    background: none;
    border: none;
    cursor: pointer;
    outline: none;
}
```

Hamburgerin büyük görünmesi için font-size ve font-weight ile ayarlama yapıyoruz. İstenmeyen çizgiden kurtulmak için border ve outlineı none veriyoruz. Sadece bordera none vermek yetmiyor, eğer outline ayarlamazsak üzerine tıkladığımızda da istemediğimiz bir çerçeve ile karşılaşıyoruz. Son olarak cursor ise buton üzerine geldiğimizde oku el ikonuna çeviriyor. 

 <div><img src="../../images/hamburger1.png" alt="hamburger" style="margin:20px" /></div>

 Hamburgerin verdiğimiz stilden sonraki hali bu.
Gelelim sidebar için oluşturacağımız eventi yazmaya. Önce sidebar oluşturup click event oluşturalım.

```html
    <aside class="sidebar">
        <h3>Kategoriler</h3>
        <ul>
            <li>
                <a href="index.html">Kazak</a>
            </li>  
            <li>
                <a href="index.html">Pantolon</a>
            </li>
        </ul>
    </aside>
```

Header taginden hemen sonra ve main taginden önce konumlandırıyoruz. Şu durumda kodumuzu çalıştırırsak en altta kategoriler kısmını görebiliriz. Şimdi sayfamızda konumlandırma işlemini yapalım.

```css
.sidebar {
    position: fixed;
  transition: all .3s;
    transform: translateX(-30rem);
    width: 30rem;
    background-color: white;
    height: 100%;

}

.sidebar.open {
    transform: translateX(0);
}
```

Buradaki ilk sınıfta 30remlik bir genişlik verdik. Bu genişliği tamamen saklamak içinse translateX -30rem veriyoruz. Böylece sidebarımız tamamen sol tarafta gizlenmiş olacak. İkinci sınıfımız ise iki sınıfa (sidebar, open) aynı anda dahil olduğunda devreye girecek. TranslateX e 0rem verdiğimiz için sidebar tamamen görünecek. “Transition” ise sidebar görünüp kaybolurken kayma efekti verecek. Tabi ki bu sınıflar tek başına tüm işi halledemez. Şimdi JS fonksiyonlarını yazalım. Biraz önce eklediğimiz hamburger butonu içine onclick eventini ekliyoruz.

```html
     <button onclick="openMenu()">
       &#9776;
     </button>
```

Sırada bu fonksiyonu yazmak var. En alta body tagi üzerine bir script tagi açıyoruz. İçine fonkiyonlarımızı tanımlayacağız.

```js
<script>
    function openMenu(){
        document.querySelector(".sidebar").classList.add("open");

    }
</script>
```

İlk fonksiyonumuzu oluşturduk. Artık hamburger butonuna bastığımızda sidebar açılacak. Şimdilik kapatma özelliğimiz yok. Sıradaki işimiz ise onu oluşturmak.
Sidebar içinde kategoriler yazısı altına bir buton oluşturuyoruz ve içine yine onclick  eventi ekliyoruz. 

```html
        <h3>Kategoriler</h3>
        <button class="sidebar-close-button" onclick="closeMenu()">X</button>
```

Ve script tagi içine bu fonksiyonumuzu da tanımlayalım.

```js
    function closeMenu() {
        document.querySelector(".sidebar").classList.remove("open");
    }
```

Bu fonksiyon butona basıldığında geçerli olan open sınıfını kaldırır. Kodu çalıştırırsak artık X butonuna bastığımızda sidebarı kapatabildiğimizi görürüz. Şimdi kapama butonuna stil verelim. 

```css
.sidebar-close-button {
    border-radius: 50%;
    border: 1px solid #a3a3a3;
    background-color: white;
    width: 3rem;
    height: 3rem;
    padding: .5rem;
    font-weight: bold;
    cursor: pointer;
    outline: none;
    position: absolute;
    right: .5rem;
    top: 1.5rem;
}
```

Bu işlemle butonumuza stil veriyoruz. Position, right ve top ile butonun nerede konumlanacağını ayarladık. Border Radius ile butona yuvarlak görümünü verdik. 

