Tabi ki istediğimiz görüntü bu değil. Şimdi stil verme işlemine geçelim.

```css
.container {
  margin: 0 10rem;
}

.details {
  display: flex;
  justify-content: space-between;
  align-items: flex-start;
  flex-wrap: wrap;
}

.details-image {
  flex: 2 1 auto;
}
.details-image img {
  max-width: 60rem;
}
.details-info {
  flex: 1 1 auto;
}
.details-action {
  flex: 1 1 auto;
}
```

Öncelikle tüm içeriği container içine alıp yanlardan margin veriyoruz. Ve “details” sınıfına display: flex vererek içeriği esnek bir yapıya dönüştürüyoruz. Justify-content:space-between içeriğimizi her bir div ayrı olacak şekilde soldan sağa aralarına boşluk veriyor. Align-items: flex-start yukarıdan aşağıya, içeriklerimizi yukarıdan başlatıyor. Son olarak “Wrap” ekranın küçültülmesi durumunda öğeleri aşağıya doğru sıralıyor.
Her bir div için ayrı sınıf belirleyip buradaki flex ölçülerini de belirtiyoruz.details-action sınıfımız henüz yok. O sınıfımız sepete ekleme işlemlerinin yapılacağı div olacak. .details-info sınıfına dahil olan divin hemen altına konumlandıracağız.

```js
 <div className="details-action">
                    <ul>
                        <li>
                            Fiyat: {product.price} ₺
                        </li>
                        <li>
                            Durum: {product.status}
                        </li>
                        <li>
                            Adet: <select>
                            <option>1</option>
                            <option>2</option>
                            <option>3</option>
                            <option>4</option>
                            </select>
                        </li>
                        <li>
                            <button className="button">Sepete Ekle</button>
                        </li>
                    </ul>
                </div>
```

Ürünün fiyatı, ürünün stok durumu, kaç adet alınacağını seçebileceğimiz select inputu ve son olarak sepete ekle butonunu ekliyoruz. ve stil vermeye devam ediyoruz.

```css
.details-info ul, .details-action ul {
  list-style-type: none;
  padding: 0;
}
.details-info li, .details-action li{
  margin-bottom: 2rem;
}
```

Ul içlerindeki style-type ı kaldırıyoruz ki istenmeyen liste stilinden kurtulalım. Ve her li için margin vererek aralarında boşluk oluşturuyoruz. 

```css
.details-action{
  border: 1px solid #a3a3a3;
  border-radius: 0.5rem;
  padding: 1rem;
}
```

Bu ekleme ile seçimlerin yapılacağı bölgeyi kutucuk içine alıyoruz.

```css
.details-action ul li:last-child {
  display: flex;
  flex-direction: column;
}
.button {
  padding: 1rem;
  background-color: #fc6405;
  color: white;
  border-radius: 0.5rem;
  outline: none;
  border: none;
  cursor: pointer;
}
.button:hover {
  background-color: #f87c2e;
}
```

İlk olarak .details-action sınıfında ul içinde li nin son öğesini seçiyoruz, ki bu butonumuz oluyor. Verilmiş özellikler butonumuzu enine genişletiyor. Ve son olarak butonumuza istediğimiz özellikleri veriyoruz. Üzerine geldiğimizde hover ile renk değişikliği ayarlıyoruz.


